const React = require('react')
const ReactDOMServer = require('react-dom/server')
const App = require('../Frontend/src/App.jsx')

const express = require('express');
const path = require('path');
const app = express();
const port = 3000;

console.log('Iniciando o backend...'); // Adicione este log

app.set('view engine', 'ejs');
app.set('views', path.join(__dirname, 'views'));

app.get('/', (req, res) => {
  console.log('Rota / acessada'); // Adicione este log
  const appHtml = ReactDOMServer.renderToString(<App />);
  res.render('index', { root: appHtml });
});

app.listen(port, () => {
  console.log(`Servidor rodando na porta ${port}`);
});

console.log('Fim do arquivo index.js'); // Adicione este log

